def predict(triples: list[Triple]) -> str:
    sentence = ""
    clauses = []
    for triple in triples:
        predicate = triple.predicate
        subject = triple.subject
        object_ = triple.object

        if predicate == "author":
            clauses.append(f"{subject} is written by {object_}")
        elif predicate == "isbnNumber":
            clauses.append(f"The ISBN number of {subject} is {object_}")
        elif predicate == "followedBy":
            clauses.append(f"{subject} is followed by {object_}")
        elif predicate == "language":
            clauses.append(f"{subject} is written in {object_}")
        elif predicate == "country":
            clauses.append(f"{subject} is in {object_}")
        elif predicate == "capital":
            clauses.append(f"The capital of {subject} is {object_}")
        elif predicate == "numberOfPages":
            clauses.append(f"{subject} has {object_} pages")
        else:
            clauses.append(f"{subject}'s {predicate} is {object_}")

    sentence = ", ".join(clauses) + "."
    return sentence

